function d3Format(array) {
  result = [];
  for (var i = 0; i < array.length; i++) {
    ith_result = [];
    for (var j = 0; j < array[i].length; j++) {
      var object = {};
      // console.log(array[i].tradingDay);
      object["date"] = array[i][j].tradingDay;
      object["value"] = array[i][j].close;
      ith_result.push(object);
    }
    result.push(ith_result)
  }
  return result
}

